    "brief_info": "div class\"showmorelesshtml__markup showmorelesshtml__markupclampafter5            relative overflowhidden\"          pTransforming Lives through Career OpportunitiesppbrppThe Assistant Product Manager oversees the downstream marketing of Cardiovascular portfolio throughout India This role involves conceptualizing marketing campaigns and collaborating with regional sales teams for effective implementation Beyond standard marketing tasks the specialist is also expected to contribute to market development strategies This position offers a chance to engage with the diverse Indian healthcare landscape and collaborate with marketing professionals globallyppbrppbrppA Typical Dayppbrpp Craft holistic marketing strategies encompassing competitive analysis pricing sales forecasts inventory control and brand communicationpp Collaborate with global teams to formulate localized marketing tactics and strategic planspp Manage inventory including quarterly and annual forecasts while minimizing product obsolescencepp Conduct primary and secondary research to gather market insights on competitive pricing and product positioningpp Design and implement marketing strategies for new product launches and technologies covering clinical messaging engagement with physicians pricing strategies and salespp Lead patientcentric campaigns through digital advertising media publications and awareness programspp Establish and execute strategic launch plans setting 35year growth objectivespp Cultivate strong relationships with key opinion leaders industry experts and partners to enhance product acceptance expand therapy usage and ensure the safe and effective use of Medtronic CRM productspp Collaborate with internal teams across legal regulatory clinical PR and RampD to ensure alignment and successful execution of marketing planspp Engage extensively with sales teams and customers to grasp their insights and perspectives Keep abreast of evolving market trends and customer preferences Act as the customers advocate in internal discussions and represent the company at advisory boards and medical conferencesppbrppQualificationsppbrppEssentialsppbrpp Bachelors degree MBA is preferredpp 5 to 7 years of relevant experience or an advanced degree with at least 3 years of relevant experienceppbrppDesirable Skillsppbrpp Proficiency in data management MS Excel and MS PowerPointpp Ability to deliver compelling presentations to large audiences both online and offlinepp Strong communication skills both written and verbalpp Selfmotivated with a proven track record in achieving business results through meticulous planning and executionpp Customerfocused teamoriented and skilled in prioritizing taskspp Background in capital expenditure capex salesmarketing is advantageousp        div",
